INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'consultation_phone', 'Консультация юриста бесплатно по телефону круглосуточно – это удобно и просто. Постарайтесь подробно объяснить все нюансы возникших трудностей.<br><br>Консультация начинается с выяснения сути проблемы, фактических обстоятельств дела и событий, предшествующих возникновению проблемы. Очень часто юристу приходится выступать в качестве психолога, так как за любой человеческой проблемой стоят эмоции. ');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'consultation_online', 'Сайт предоставляет пользователям возможность задать вопрос онлайн квалифицированным юристам в чате, по почте, в мессендерах Ватсапп и Телеграмм.<br><br>Существует способ получения консультации юриста с использованием сети Интернет, так называемая юридическая консультация онлайн. ');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'consultation_office', 'Если ваш вопрос предполагает изучение документов, нужно рассказать историю не по телефону, обсудить запутанные вопросы права с вариантами действий - юридическая консультация в офисе лучший выбор. <br><br>Находясь в офисе, юрист сможет ознакомится с имеющейся у него библиотекой, уточнить законодательство и дать вам исчерпывающий, правильный юридический совет.');
