INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'termsOfSolution_tabs_0_text', 'В законодательстве существуют четко установленные сроки для защиты прав потребителей для обращения с претензией к продавцу, или в суд. Во всех случаях исполнителю работ или услуг можно предъявить претензию при обнаружении недостатков в работе или услуге. Либо это можно сделать в ходе исполнения работ или услуг. Если же недостатки не были обнаружены в момент передачи или их обнаружить было невозможно, то претензию предъявляют в течение гарантийного срока.');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'termsOfSolution_tabs_0_whatOtherSays', 'После того, как потребителем были выявлены недостатки и доказано, что они возникли до принятия результата работы или услуги, потребитель вправе требовать об устранении недостатков за счет исполнителя. Такое право предоставляется потребителю и по истечении двухлетнего срока (5 для недвижимого имущества) с момента принятия результата работы или услуги.');
