INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'termsOfSolution_guarantees', 'Прописываем все сроки в договоре. Как подрядчик мы несем ответственность за нарушение любого установленного срока (начального, конечного, промежуточного), если иное не установлено законом и иными правовыми актами или договором.');
