INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionOne_video_url', 'https://www.youtube.com/watch?v=dQw4w9WgXcQ');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionOne_video_title', 'О работе с физлицами\r\nза 1 минуту');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionOne_head', 'Решения для физических лиц');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionOne_text', 'В настоящее время любой человек может столкнуться с проблемами юридического свойства, разрешить которые самостоятельно без помощи опытного специалиста вряд ли получится. Поэтому те услуги, которые оказывает юрист физическим лицам, являются актуальными и востребованными.\r\n\r\nСпектр юридических услуг для физлиц чрезвычайно широк, он начинается от консультаций по вопросам современного права и заканчивается представлением интересов физлица и ведением дел в судебных инстанциях различного уровня.');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionOne_ours_0_item', 'Работаем и с россиянами и с иностранцами;');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionOne_ours_1_item', 'Индивидуальный подход;');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionOne_ours_2_item', 'Полное консультационно-справочное сопровождение');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionOne_ours', '3');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionTwo_head', 'Решения для бизнеса');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionTwo_subhead', 'Предоставляем не услуги, а результат');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionTwo_text_1', 'В современном обществе мы постоянно сталкиваемся с ущемлением наших прав. Такие мелочи зачастую портят нам не только настроение, но и нервную систему. Заявить свои права грамотно, отстоять точку зрения и выйти из сложной сложившейся ситуации поможет квалифицированный личный юрист.\r\n\r\nУслуги домашнего юриста оплачиваются в виде абонентской платы, чаще всего периодом расчета является месяц. Несомненным плюсом является то, что получить консультацию можно в любой момент. Это может быть звонок или встреча.');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionTwo_text_2', 'Специализируемся на сложных коммерческих спорах в интересах крупного и среднего бизнеса. \r\n\r\nЗа годы практики сумма защищенных активов превысила 44 млрд долларов.');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionTwo_text_3', 'Стоимость услуг личного юриста зависит от его квалификации, спектра предоставляемых вам услуг и возможных рисков. Обладание юридической информацией диктуется правилами современного общества. В нашей компании работают компетентные во многих сферах права специалисты, которые помогут вам консультацией и делом.');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'weWorkWith_sectionTwo_text_4', 'Мы даем результат');
