INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'mainPage_garantees_2_text', '<p>Если <b>в течении 1 года</b> с момента оказания Вам наших услуг возникли какие то\r\n                проблемы, связанные с ними, мы выступим в качестве третьего лица на Вашей\r\n                стороне бесплатно!</p>');
