INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'likbez_0_likbez_content_0_likbez_content_title', 'Юридическое сопровождение банковских дел');
INSERT INTO `object_meta_entries` (`object_id`, `meta_key`, `meta_value`) VALUES (23, 'likbez_0_likbez_content_0_likbez_content_text', 'Махинации на финансовом рынке – это то, с чем мы рискуем столкнуться изо дня в день. Все чаще обманутые люди говорят о некачественных услугах, об ущемлении своих прав, о тотальном произволе и самоуправстве со стороны банковских структур.\r\n\r\nПочему-то принято полагать, что спор с банком – это пустая трата времени и средств. Разумеется, это мнение сложно назвать безосновательным. На стороне финансовой структуры – целый штат грамотных адвокатов, справиться с которыми своими силами, и правда, не выйдет.\r\n\r\nЧтобы не проиграть в неравном бою, следует обратиться за помощью к компетентному специалисту – юристу по банковской отрасли права.');
